function Diploma() {
    return (
        <div className="container-fluid row  text-center m-0 p-0 mt-4 py-3  myshadow" style={{background: 'white'}}
            id="mainDiplomaContainer">
            <div className="col-md-12">
                <h1 className="fw-bolder">All <font color="red"> Diploma Course </font>
                </h1>
                <small className="d-flex px-2"> <a href="index.html" className="nav-link"><i className="fa fa-home"> </i> / </a> &nbsp; Diploma
                    Courses </small>
            </div>
        </div>
    )
}
export default Diploma
